import React from "react";
import ReactDOM from "react-dom";
import Provider from "@reduxjs/toolkit";

import "./index.css";
import App from "./App";

ReactDOM.render(
  <React.StrictMode>
    <Provider>
      <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById("root") || document.createElement("div")
);
